import React from 'react';
import Index from "./views/index";
import About from "./views/about"
import Project from "./views/project"
import {Carousel} from "antd"
import eight from "./static/img/8.jpg"
function App() {
  return (
    <div className="App">
      <Carousel
        dotPosition="right"
      >
        <div className="ban">
          <Index />
        </div>
        <div>
          <About/>
        </div>
        <div><Project/></div>
      </Carousel>
    </div>
  );
}

export default App;
